/**
* Gets Students data by Term from legit Peoplesoft Tables
* @company CCC Tech Center
* @version 4.1.0
*/
class CCTC_Students
   method CCTC_Students();

   method getStudents(&bindVars As array of any) Returns array of array of any;

   method getOrientationStatus(&bindVars As array of any) Returns array of array of any;

   method getEducationPlan(&bindVars As array of any) Returns array of array of any;

   method getAdmissionStatus(&bindVars As array of any) Returns array of array of any;

   method getAssessments(&bindVars As array of any) Returns array of array of any;

   method getDisabilitySupportEligibility(&bindVars As array of any) Returns array of array of any;

   method getEnrollmentHolds(&bindVars As array of any) Returns array of array of any;

   method getDualCreditStatus(&bindVars As array of any) Returns array of array of any;

   method getVisaStatus(&bindVars As array of any) Returns array of array of any;

   method getEnrollmentAppt(&bindVars As array of any) Returns array of array of any;

   method getIncarcerationStatus(&bindVars As array of any) Returns array of array of any;

   method getFinancialAidAwards(&bindVars As array of any) Returns array of array of any;

   method getResidencyStatus(&bindVars As array of any) Returns array of array of any;

   method getTuitionOwed(&bindVars As array of any) Returns array of array of any;

end-class;

method CCTC_Students
   rem do nothing;
end-method;

/**
* This function provides an interface to the College Adaptor to 
* retrieve a listing of students for a given term with thier external id
* 
* @param &bindVars[1]: Term
* @param &bindVars[2]: Institution
* @param &bindVars[3]: Academic Career
* @param &bindVars[4]: External System
* @Returns 2d array with a row/array per student in list
*/
method getStudents
   /+ &bindVars as Array of Any +/
   /+ Returns Array2 of Any +/

   rem validate parameters/arguments;
   If &bindVars.Len <> 4 Then
      Error "bindVars should have 4 elements when getting students by term";
   End-If;

   If None(&bindVars [1]) Then
      Error "Term is required";
   End-If;

   If None(&bindVars [2]) Then
      Error "Institution is required";
   End-If;

   If None(&bindVars [3]) Then
      Error "Acad Career is required";
   End-If;

   If None(&bindVars [4]) Then
      Error "External System is required";
   End-If;

   Local array of any &AAny = CreateArrayAny();
   Local array of array &result_list = CreateArrayRept(&AAny, 0);

   Local SQL &sql = GetSQL(SQL.CCTC_STDNTS_TRM_GET, &bindVars);
   If &sql.Status <> %SQLStatus_OK Then
      Error String(&sql.Status);
   Else
      While &sql.Fetch(&AAny)
         Local number &j = 0;
         Local array of any &temp = CreateArrayAny();
         For &j = 1 To &AAny.Len
            &temp.Push(&AAny [&j]);
         End-For;
         &result_list.Push(&temp);
      End-While;
   End-If;
   &sql.Close();

   Return &result_list;

end-method;

